import React from 'react';


const VideoDetail = ({video}) => {
    // instead of props.video => video
    if(!video){
       return <div>Loading...</div>
    }

    return (
        <div className="ui segment" >
            <div className="ui header" >
                {video.snippet.title}
            </div>
        </div>
    )
}

export default VideoDetail
